import React from 'react';

function InputWord({ word, setWord, onTranslate }) {
    return (
        <div>
            <input
                type="text"
                value={word}
                onChange={(e) => setWord(e.target.value)}
                placeholder="Введіть англійське слово"
                style={{ padding: '8px', width: '70%', marginRight: 10 }}
            />
            <button onClick={onTranslate} style={{ padding: '8px 16px' }}>
                Перекласти
            </button>
        </div>
    );
}

export default InputWord;
